exports=async function(url,bid,cid,options){const{parseContentPaginate,getLinkElement}=await require("transcode/parse_content");return parseContentPaginate(page=>1===page?url:url.replace(".html",`_${page}.html`),"#TextContent",{clientOptions:{...(options&&options.clientOptions)},hasNextFn:html=>null!=/\/[a-zA-Z\d]+_\d+\.html/.exec(getLinkElement(html,"id=\"next_url\""))})};